import React from 'react';
import './App.css';
import { Switch, Route, BrowserRouter as Router } from "react-router-dom";
import Login from "./components/Login"

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/login" components={Login} />
      </Switch>
    </Router>
  );
}

export default App;
